import React from "react";
import "../../../Styles/Pages/About/AboutFifth.scss";

function AboutFifth() {
  return (
    <div className='aboutFifth'>
      <div className='aboutFifth__content'>
        <div className='line'></div>
        <h3>Join our team</h3>
      </div>
    </div>
  );
}

export default AboutFifth;
